INSERT INTO `project_hotel` VALUES (37,'Hotel Royal Asia','Jln. Veteran no. 521 Palembang, Indonesia',160,'(+62-711) 372372 (HUNTING) 362589-362891','480000','Positif:\n* taxi ke kampus: <30rb (tarif minimal taxi 30rb)\n* shuttle bus bandara: tidak ada taxi dr bandara ke hotel: 90rb - 100rb\n* breakfast : kue, salad,  nasi goreng/nasi kuning/nasi lemak, lontong sayur, roti tawar, cereal, bubur, macam2 jus, kopi, teh, air putih, buah\n* air mineral botol: ada\n* dinner: ada kaki lima yg terjangkau dg jalan kaki, kfc di samping hotel\n* pemanas air: ada\n* kopi/teh: ada\n* sikat gigi, sabun: ada\n* handuk: ada\n* sandal: ada\n* listrik: stabil nyala terus\n* mini market: ada indomaret, alfamart yg terjangkau dg jalan kaki (Gete-Yap)\n* food delivery: terjangkau: ph\n* listrik kamar: hidup dengan sebarang kartu \n* shower air panas: ada dan relatif bisa diandalkan (24 jam), ada bath up\n* dinding kamar mandi: solid\n* tv kabel : ada\n\nNegatif:\n* colokan listrik: jauh dg kasur tapi banyak shg gak perlu gantian\n* Wifi nya setiap +- 15menit an harus login lagi\n* wifi : ada tapi per 15 menit an harus login ulang, kuat utk akses aplikasi acs\n\nBlm tau/blm ditanyakan:\n* extra bed\n* kuitansi\n** kaku: hrs sesuai nama yg menginap\n** fleksibel: bisa berikan nama2 yg ingin ditulis di kuitansi (tenaga ahli) alias boleh berbeda dg yg beneran menginap','-'),(38,'Hotel Soechi International','Jalan Cirebon No. 76A, Sumatera Utara 20212, Indonesia',120,'+62 61 4561234','496000 - 528000','The warm rooms and suites feature free Wi-Fi, flat-screen TVs, and tea and coffeemaking facilities. Suites add sitting areas, and upgraded suites include extra TVs. Room service is offered 24/7.\nA breakfast buffet and an airport shuttle are complimentary.','This elegant hotel with old-world features is a 13-minute walk from the Kereta Api Medan train station, 1.3 km from the Great Mosque of Medan and 33 km from Kualanamu International Airport.'),(39,'Hotel Cepu Indah 1','Jl. Diponegoro No. 32, Cepu, Kec. Blora Kota, Jawa Tengah 58312, Indonesia',330,'+62 296 423899','398000','-','-'),(40,'Hotel Menara Lexus [BlackList]','Jl. Sisingamangaraja, Medan, Kota Medan, Sumatera Utara 20218, Indonesia',120,'+62 61 7882777','365000','Positif:\n* air mineral botol: ada\n\nNegatif:\n* breakfast : kurang enak cuma ada mie, nasi sama teh saja. \n\nBlm tau/blm ditanyakan:\n* taxi ke kampus: <30rb (tarif minimal taxi 30rb)\n* shuttle bus bandara: tidak ada taxi dr bandara ke hotel: 90rb - 100rb\n* extra bed\n* kuitansi\n** kaku: hrs sesuai nama yg menginap\n** fleksibel: bisa berikan nama2 yg ingin ditulis di kuitansi (tenaga ahli) alias boleh berbeda dg yg beneran menginap\n* dinner: ada kaki lima yg terjangkau dg jalan kaki, kfc di samping hotel\n* pemanas air: ada\n* kopi/teh: ada\n* sikat gigi, sabun: ada\n* handuk: ada\n* sandal: ada\n* listrik: stabil nyala terus\n* mini market: ada indomaret, alfamart yg terjangkau dg jalan kaki (Gete-Yap)\n* food delivery: terjangkau: ph\n* listrik kamar: hidup dengan sebarang kartu \n* shower air panas: ada dan relatif bisa diandalkan (24 jam), ada bath up\n* dinding kamar mandi: solid\n* tv kabel : ada\n* colokan listrik: jauh dg kasur tapi banyak shg gak perlu gantian\n* Wifi nya setiap +- 15menit an harus login lagi\n* wifi : ada tapi per 15 menit an harus login ulang, kuat utk akses aplikasi acs','* tersedia bar didalam hotel ini dan isinya cuma minuman keras\n* kalau malam banyak pria hidung belang\n* tidak disarankan untuk user perempuan'),(41,'Hotel Madani','JL. Sisingamangaraja/ Amaliun No. 1, Sumatera Utara 20215, Indonesia',120,'+62 61 7358000','430000','-#Positif \n* ke kampus: taxi: 40rb - 70rb \n* wifi: ada dan bisa utk akses aplikasi acs\n* extra bed: bisa \n* breakfast: ada: nasi, roti tawar, susu sereal, buah, jus jeruk , sosis, bubur, nasi goreng\n* air mineral botol: ada \n* pemanas air: ada \n* kopi/teh: ada \n* sikat gigi: ada \n* handuk: ada \n* sandal: ada\n * listrik: kadang mati dan mengandalkan genset\n* minimarket: ada super market disebelah hotel (yuki simpang raya)\n* dinding kamar mandi: solid : \n* taxi bandara jam setengah 4 pagi bisa dijemput #bayar \n* AC : menyala dengan baik \n* lemari : masih bagus \n* Luas kamar : kamar cukup luas (superior)\n* makan malam : dapat pergi ke belakang hotel terdapat food court, atau di mall yuki simpang raya terdapat MCD dan Texas chiken\n* view : Genteng rumah warga\n* Lantai : kamar terletak pada lantai 3 sampai 6\n* sajadah : ada\n\n #Negatif: \n* colokan listrik: hanya ada 1 buah didalam ruangan dan satu lagi di kamar mandi\n* Bantal : jika tidak bersarung terlihat jamur pada bantal tersebut.\n\n#Belum tau/belum ditanyakan: \n* kuitansi: \n** kaku: harus sesuai nama yg menginap \n** fleksibel: cukup berikan nama2 yg ingin ditulis (tenaga ahli)','Secara keseluruhan hotel ini cukup bagus, namun terdapat beberapa kekurangan seperti gedung yang menggunakan arsitektur yang sudah tua..'),(43,'Golden Harvest Hotel','Jl. Kapten Pattimura No.65, Simpang Rimbo, Terminal Baru, Kota Jambi 28292, Indonesia',150,'+62 741 581758','300000 - 400000','Positif :\n* ke kampus: taxi: 35rb - 100rb\n* shuttle bus bandara: ada dan gratis\n* wifi: ada dan bisa utk akses aplikasi acs\n* extra bed: bisa\n* breakfast: ada: nasi, mie, bubur, roti tawar, susu sereal, buah, sari jeruk/jambu\n* air mineral botol: ada\n* dinner: jauh harus naksi\n* colokan listrik: deket dg meja/kasur dan gak perlu gantian\n* pemanas air:	ada\n* kopi/teh: ada\n* sikat gigi: ada\n* handuk: ada\n* sandal: ada\n* listrik: kadang mati dan mengandalkan genset\n* minimarket: ada franchise (alfamart, dll.) yg terjangkau dg jalan kaki (GeTe-Rs Yap?)\n* food delivery:	terjangkau: kfc\n* dinding kamar mandi: solid\n\nNegatif:\n* listrik kamar:	mati jk tidak pakai kartu kamar\n* shower air panas:	tidak ada/hanya sekali mandi trus habis\n\nBelum tau/belum ditanyakan:\n* kuitansi: \n** kaku: harus sesuai nama yg menginap\n** fleksibel: cukup berikan nama2 yg ingin ditulis (tenag